import React, { useEffect } from 'react'
import "./page1.css"
import { useNavigate } from 'react-router-dom';

const Page1 = () => {
    const navigate = useNavigate();
    useEffect(() => {
      console.log("Hiiiii");
      
    }, [])
    
    const goToPage2 = () => {
      navigate('/page2');
    };
  
    return (
      <div className='bg-red-500 h-[100vh]'>
        <h1>Page 1</h1>
        <button onClick={goToPage2}>Go to Page 2</button>
      </div>
    );
}

export default Page1
